import * as React from 'react';
import { SVGProps } from 'react';

const IconSortUpSizeXs = (props: SVGProps<SVGSVGElement>) => (
  <svg viewBox="0 0 12 12" xmlns="http://www.w3.org/2000/svg" {...props}>
    <path d="M5 3v1H1V3h4zm3 4V6H1v1h7zm3 3V9H1v1h10z" />
  </svg>
);
export default IconSortUpSizeXs;
